pub const CULPRIT_TRANSACTION_BASE64: &str = "";


#[cfg(test)]
mod tests {
    use super::*;
    use aptos_protos::transaction::v1::Transaction;
    use aptos_indexer_grpc_utils::compression_util::CacheEntry;
    #[test]
    fn test_file_entry_key_to_string_base64_uncompressed_proto_2() {
        let bytes = CULPRIT_TRANSACTION_BASE64.to_string().as_bytes().to_vec();
        let cache_entry = CacheEntry::Base64UncompressedProto(bytes);
        let transaction = cache_entry.into_transaction();
        assert_eq!(transaction.version, 972398288);
    }
}